import classes from './OnePresentation.module.css';

import {BiEdit} from 'react-icons/bi'
import {BsBoxArrowUpRight,BsUpload, BsTrash,BsXLg, BsFileEarmarkPdf} from 'react-icons/bs';
import { Link } from 'react-router-dom';



const OnePresentation =(props)=>{



   let imageurl = "https://edresearch.co.in/"

   const openFileInNewTabHandler=()=>{

   let meetingLink = 'http://diracai.com';
       window.open(meetingLink, "_blank");
   }






return <div className={classes.onePresentation}>


         <div className={classes.onePresentation_talkTitleDiv}> 
		<i > <span className={classes.talkID}> {props.presentation.id} </span> 
		    <b style={{color:"var(--themeColor)"}}>{props.presentation.talktitle} </b>
		</i>

		<i>  Speaker: {props.presentation.speaker.firstname} {props.presentation.speaker.lastname}</i>

	</div>


	 <div className={classes.onePresentation_talkTitleDiv}> <span style={{color:"grey"}}> Time:  8:00pm (India/Kolkata Time), 15 Minutes </span></div>	

         <div className={classes.onePresentation_talkTitleDiv} style={{color:"grey"}}> 

	    <span> Attachments:
                     {/*
                     <button className={classes.deleteTalkFile}><BsXLg/> </button>

	             <Link to={{pathname: `${imageurl}`}}  target="_blank" style={{marginLeft:"3px"}}>  
	                 <span className={classes.uploadedFile}>
	                    Update_22ndMay2022.pdf 
	                 </span>

	                 <BsBoxArrowUpRight className={classes.redirectIcon}/>

	             </Link>
                      */}


                       {
                         props.presentation.talkfiles.map((talkfile,index)=>{
                           return <button onClick={openFileInNewTabHandler} className={classes.uploadedFile}>
                                     <BsFileEarmarkPdf className={classes.uploadfileIcon}/>
                                        Update_22ndMay2022.pdf

                                  </button>

			 })

		       }










	     <button style={{marginLeft:"20px",borderStyle:"none",cursor:"pointer",fontSize:"17px",color:"grey"}}> 
		+add file 
	     </button>

	    </span>	


            <span>
            <button className={classes.talkEditButton}> <BiEdit/> </button>
	    <button className={classes.talkEditButton}> <BsTrash/> </button>
            </span>

	</div>


</div>


}

export default OnePresentation;
